import React, {Component} from 'react';
/*import ErpIconitem from './ErpIconitem';*/

class ListClientsitem extends Component {

    render(){
        let {rowClass, image, imgLogo, nameClient, dClient, item1, item2, item3} = this.props;
        return(
            <div id={nameClient} className={`row erp_item_features align-items-center ${rowClass}`}>
                <div className="col-lg-6">
                    <div className="erp_features_img_two">
                        <img src={require ("../../img/erp-home/" + image).default} alt=""/>
                    </div>
                </div>
                <div className="col-lg-6">
                    <div className="erp_content_two">
                        <div className="hosting_title">
                            
                            {/* <h2>{nameClient}</h2> */}
                            <img className="pb-3" src={require ("../../img/new/" + imgLogo).default} alt=""/>
                            <p>{dClient}.</p>
                        </div>
                        <div>
                            <ul className="analytices_list">
                                <li>{item1}</li>
                                <li>{item2}</li>
                                <li>{item3}</li>
                            </ul>
                            
                        </div>
                        {/* <ErpIconitem iconName="icon_menu-square_alt2" erpText="Everybody Gets a Dashboard"/>
                        <ErpIconitem iconName="icon_ribbon_alt" erpText="Everybody Gets a Dashboard"/> */}
                    </div>
                </div>
            </div>
        )
    }
}
export default ListClientsitem;
